Construction Environmental Management Plan and Site Waste Management Plan

No development shall commence, including any works of demolition, until a Construction Environmental Management Plan (CEMP) and a Site Waste Management Plan (SWMP) have been submitted to and approved in writing by the Local Planning Authority.  These Plans shall incorporate details of:

a)	construction traffic management;
b)	the parking of vehicles of site operatives and visitors;
c)	loading and unloading of plant and materials;
d)	storage of plant and materials used in constructing the development;
e)	the erection and maintenance of security hoarding(s) including decorative displays and facilities for public viewing, where                                appropriate;
f)	wheel washing facilities;
g)	measures to control the emission of dust, dirt and emissions to air during construction; such measures to accord with the guidance                  provided in the document "The Control of Dust and Emissions during Construction and Demolition", Mayor of London, July 2014;                     including but not confined to, non road mobile machinery (NRMM) requirements;
h)	noise and vibration control;
i)	a scheme for recycling/disposing of waste resulting from demolition and construction works;
j)	the use of efficient construction materials;
k)	methods to minimise waste, to encourage re-use, recovery and recycling, and sourcing of materials; and
l)	a nominated Developer/Resident Liaison Representative with an address and contact telephone number to be circulated to those                   residents consulted on the application by the developer's representatives. This person will act as first point of contact for residents                  who have any problems or questions related to the ongoing development.

Once approved the Plans shall be adhered to throughout the construction period.

Reason:  The CEMP and SWMP are required prior to commencement of development in order to reduce the environmental impact of the construction and the impact on the amenities of neighbouring residents, and in accordance with policy BP8 of the Borough Wide Development Policies Development Plan Document.

Hard Landscaping

The development hereby permitted shall not be occupied until full details of the hard landscaping have been submitted to and approved in writing by the Local Planning Authority.  The hard landscaping scheme shall include, but not be limited to, details of the following:

a)	surface materials;
b)	communal roof terraces, including details of balustrading and screening to ensure a secure and sheltered environment;
c)	play spaces and any related equipment;
d)	street furniture, including on-street cycle stands;
e)	boundary treatment; and
f)	management and maintenance.

The hard landscaping scheme shall be implemented prior to occupation of the development in accordance with the approved details and thereafter permanently maintained, to the satisfaction of the Local Planning Authority.

Reason:  In the interests of design quality, residential amenity, walking, accessibility and public safety, in accordance with policy CP3 of the Core Strategy and policy BP11 of the Borough Wide Development Policies Development Plan Document.
